class Solution:
    def isValid(self, s: str) -> bool:
        arrString = [x for x in s]
        stack = []
        if len(arrString) == 1:
            return False
        for letter in arrString:

            # topOfStack = stack[-1]
            if letter == "(":
                stack.append(letter)
            if letter == "[":
                stack.append(letter)
            if letter == "{":
                stack.append(letter)
            if letter == ")":
                if stack[-1] != "(":
                    return False
                stack.pop()
            if letter == "]":
                if stack[-1] != "[":
                    return False  
                stack.pop()        
            if letter == "}":
                if stack[-1] != "{":
                    return False
                stack.pop()
        
        openBracket = s.count("(")
        closedBracket = s.count(")")
        openSquare = s.count("[")
        closedSquare = s.count("]")
        openCurly = s.count("{")
        closedCurly = s.count("}")

        if (openBracket == closedBracket and openSquare == closedSquare and openCurly == closedCurly):
            return True
        else:
            return False

